import React from 'react';

const Logo: React.FC = () => {
  return (
    <div className="flex items-center space-x-4">
      {/* UOttawa EE Logo */}
      <div className="p-3 bg-white rounded-none border-2 border-black shadow-brutal">
        <div className="w-8 h-8 flex items-center justify-center">
          <div className="w-6 h-6 relative">
            {/* UOttawa building - simplified but recognizable */}
            {/* Pediment (triangular roof) */}
            <div className="absolute top-0 left-1/2 transform -translate-x-1/2 w-4 h-1 bg-black"></div>
            {/* Main building */}
            <div className="absolute top-1 left-1 w-4 h-3 bg-black"></div>
            {/* Columns as white lines */}
            <div className="absolute top-1.5 left-1.5 w-0.5 h-2 bg-white"></div>
            <div className="absolute top-1.5 left-2.5 w-0.5 h-2 bg-white"></div>
            <div className="absolute top-1.5 left-3.5 w-0.5 h-2 bg-white"></div>
            {/* Base */}
            <div className="absolute bottom-0 left-1 w-4 h-0.5 bg-black"></div>
            {/* EE accent */}
            <div className="absolute top-2 left-2.5 w-1 h-1 bg-red-500"></div>
          </div>
        </div>
      </div>
      <div>
        <h1 className="text-2xl font-black text-black">Electrical Engineering</h1>
        <p className="text-sm font-bold text-black">University of Ottawa - Course Timeline</p>
      </div>
    </div>
  );
};

export default Logo;
